(14, 14, 'El híbrido producto del cruce entre un leopardo macho y una leona.'),
(15, 15, 'A hybrid resulting from the crossing of a male leopard with a lioness.'),
(16, 16, 'Un félin hybride, produit du croisement entre un léopard mâle et une lionne.'),
