INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(1, 1, 1, 'Liger', '<p>The&nbsp;<b>liger</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>). The liger has parents in the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>. The liger is distinct from the similar hybrid&nbsp;<a href="https://en.wikipedia.org/wiki/Tigon" title="Tigon">tigon</a>&nbsp;and is the largest of all known&nbsp;<a href="https://en.wikipedia.org/wiki/Extant_taxon" title="Extant taxon">extant</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Felidae" title="Felidae">felines</a>.<sup id="cite_ref-Xixiaku_1-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-Xixiaku-1">[1]</a></sup><sup id="cite_ref-ligerfacts2016_2-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-ligerfacts2016-2">[2]</a></sup></p><p>Ligers enjoy swimming, which is a characteristic of tigers, and are very sociable like lions. Today ligers exist only in captivity because the habitats of the parental species do not overlap in the wild. Historically, when the&nbsp;<a href="https://en.wikipedia.org/wiki/Asiatic_lion" title="Asiatic lion">Asiatic lion</a>&nbsp;was prolific, the&nbsp;<a href="https://en.wikipedia.org/wiki/Territory_(animal)" title="Territory (animal)">territories</a>&nbsp;of lions and tigers did overlap and there are legends of ligers existing in the wild. Notably, ligers typically grow larger than either parent species, unlike&nbsp;<a href="https://en.wikipedia.org/wiki/Tigon" title="Tigon">tigons</a>&nbsp;which tend to be about as large as a female tiger.<sup id="cite_ref-Xixiaku_1-1"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-Xixiaku-1">[1]</a></sup><sup id="cite_ref-ligerfacts2016_2-1"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-ligerfacts2016-2">[2]</a></sup><sup id="cite_ref-messybeast2012_3-0"><a href="https://en.wikipedia.org/wiki/Liger#cite_note-messybeast2012-3">[3]</a></sup></p>', '<p>The&nbsp;<b>liger</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>). The liger has parents in the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>.', '', 1487199831, 2),
(2, 2, 1, 'Ligre', '<p>El&nbsp;<b>ligre</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">león</a>&nbsp;y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigresa</a>. Pese a tener un origen arcano relacionado con la mitología griega, en Rusia se comprobó su existencia. Su aspecto es el de un gigantesco león con rayas de tigre difusas. Al igual que los leones, los ligres macho desarrollan melena. Su&nbsp;<a href="https://es.wikipedia.org/wiki/Nombre_cient%C3%ADfico" title="Nombre científico">nombre científico</a>&nbsp;es&nbsp;<i>Panthera leo &times; tigris</i>. Hay quienes a la hembra del ligre la llaman legresa<sup id="cite_ref-Kiara_1-0"><a href="https://es.wikipedia.org/wiki/Ligre#cite_note-Kiara-1">1</a></sup>&nbsp;o ligresa.<sup id="cite_ref-2"><a href="https://es.wikipedia.org/wiki/Ligre#cite_note-2">2</a></sup></p>', '<p>El&nbsp;<b>ligre</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">león</a>&nbsp;y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigresa</a>. Pese a tener un origen arcano relacionado con la mitología griega, en Rusia se comprobó su existencia. Su aspecto es el de un gigantesco león con rayas de tigre difusas.', '', 1487199870, 2),
(3, 3, 1, 'Ligron', '<p>Le&nbsp;<b>ligre</b>&nbsp;ou&nbsp;<b>ligron</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>&nbsp;né de l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigresse</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;mâle (l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lionne" title="Lionne">lionne</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigre</a>&nbsp;mâle donne un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigron" title="Tigron">tigron</a>&nbsp;ou tiglon). Le ligre, ainsi que tous les hybrides connus entre différentes espèces félines, est le résultat d&#39;un croisement. On rencontre rarement des hybrides félins dans la nature, du fait de l&#39;éloignement géographique dans de nombreux cas, ainsi que des périodes de reproduction différentes et surtout du comportement différent de chaque espèce vis-à-vis de l&#39;autre.</p>', '<p>Le&nbsp;<b>ligre</b>&nbsp;ou&nbsp;<b>ligron</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>&nbsp;né de l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigresse</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;mâle (l&#39;union d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lionne" title="Lionne">lionne</a>&nbsp;et d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/Tigre" title="Tigre">tigre</a>&nbsp;mâle donne un&nbsp;<a hre', '', 1487199902, 2),
(4, 4, 1, 'Tigon', '<p>A&nbsp;<b>tigon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡən/</a>) or&nbsp;<b>tiglon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡlən/</a>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Panthera leo</i>). Thus, it has parents with the same&nbsp;<a href="https://en.wikipedia.org/wiki/Genus" title="Genus">genus</a>&nbsp;but of different&nbsp;<a href="https://en.wikipedia.org/wiki/Species" title="Species">species</a>. The tigon is not currently as common as the converse hybrid, the&nbsp;<a href="https://en.wikipedia.org/wiki/Liger" title="Liger">liger</a>; however, in the late 19th<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Cleanup" title="Wikipedia:Cleanup">year&nbsp;needed</a></i>]</sup>&nbsp;and early 20th centuries, Gerald Iles wrote that he had been able to obtain three tigons, but he had never seen a liger.<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup></p><p>The tigon&#39;s genome includes genetic components of both parents.<sup id="cite_ref-autogenerated1_1-0"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-autogenerated1-1">[1]</a></sup>&nbsp;Tigons can exhibit visible characteristics from both parents:<sup id="cite_ref-autogenerated1_1-1"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-autogenerated1-1">[1]</a></sup>&nbsp;they can have both spots from the mother (lions carry genes for spots&mdash;lion cubs are spotted and some adults retain faint markings) and stripes from the father. Any&nbsp;<a href="https://en.wikipedia.org/wiki/Mane_(lion)" title="Mane (lion)">mane</a>&nbsp;that a male tigon may have will appear shorter and less noticeable than a lion&#39;s mane and is closer in type to the ruff of a male tiger. It is a common misconception that tigons are smaller than lions or tigers. They do not exceed the size of their parent species because they inherit growth-inhibitory&nbsp;<a href="https://en.wikipedia.org/wiki/Gene" title="Gene">genes</a>&nbsp;from the lioness mother, but they do not exhibit any kind of dwarfism or miniaturization; they often weigh around 180 kilograms (400&nbsp;lb).<sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup></p><p>This cross-breeding (between tiger and lioness) can cause difficulties during pregnancy because a tiger is a bigger cat than a lion.<sup id="cite_ref-2"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-2">[2]</a></sup></p><p>Genetic defects of cubs are not rare. It has been estimated that 1 in 500 000 survives, which shows a very low survival rate.<sup id="cite_ref-3"><a href="https://en.wikipedia.org/wiki/Tigon#cite_note-3">[3]</a></sup></p>', '<p>A&nbsp;<b>tigon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡən/</a>) or&nbsp;<b>tiglon</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈtaɪɡlən/</a>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;cross between a male&nbsp;<a href="https://en.wikipedia.org/wiki/Tiger" title="Tiger">tiger</a>&nbsp;(<i>Panthera tigris</i>) and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lion</a>&nbsp;(<i>Pant', '', 1487199998, 2),
(5, 5, 1, 'Tigon', '<p>Un&nbsp;<b>tigron</b>&nbsp;(ou&nbsp;<b>tiglon</b>) est un&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement artificiel d&#39;une lionne et d&#39;un tigre. Le tigron, comme le&nbsp;<a href="https://fr.wikipedia.org/wiki/Ligre" title="Ligre">ligre</a>&nbsp;(croisement entre un lion et une tigresse), n&#39;est pas rencontré dans la nature, car le lion et le tigre ont des comportements et des habitats radicalement différents.</p><p>Seul le tigron femelle est fertile. La femelle tigron ne peut se reproduire qu&#39;avec un tigre.</p><p>&nbsp;</p>', '<p>Un&nbsp;<b>tigron</b>&nbsp;(ou&nbsp;<b>tiglon</b>) est un&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement artificiel d&#39;une lionne et d&#39;un tigre. Le tigron, comme le&nbsp;<a href="https://fr.wikipedia.org/wiki/Ligre" title="Ligre">ligre</a>&nbsp;(croisement entre un lion et une tigresse), n&#39;est pas rencontré dans la nature, car le lion et le tigre ont des comportements et des habitats radicalement différents.</p><p>Seul le tigron femelle est fertile. La femelle tigron ne peut se reproduire qu&#39;avec un tigre.</p>', '', 1487200023, 2),
(6, 6, 1, 'Tigón', '<p>Un&nbsp;<b>tigón</b>&nbsp;es un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigre</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>&nbsp;criados en cautiverio. Los tigones no son tan frecuentes como los híbridos inversos, llamados&nbsp;<a href="https://es.wikipedia.org/wiki/Ligre" title="Ligre">ligres</a>, producto de la unión de un león y una tigresa. Es poco probable que los tigones se den en la naturaleza, debido a que tigres y leones no comparten hábitat.</p><p>Los tigones presentan características de los dos progenitores, con aspecto de leones con rayas de tigres. Crecen menos que las especies de origen, debido a que heredan, de la leona, genes inhibidores de crecimiento, pero no presentan ningún tipo de&nbsp;<a href="https://es.wikipedia.org/wiki/Enanismo" title="Enanismo">enanismo</a>. Generalmente pesan cerca de 180&nbsp;<a href="https://es.wikipedia.org/wiki/Kilogramo" title="Kilogramo">kg</a>.</p><p>Poseen patas y cola largas, aunque con aspecto imponente. Son menos abundantes que los ligres, ya que éstos son intensamente buscados y explotados por circos debido a su gigantismo y, en menor medida, zoológicos deseosos de atraer al público.</p><p>Generalmente, los tigones son estériles. Sin embargo, una tigona de nombre Noelle en la&nbsp;<a href="https://es.wikipedia.org/w/index.php?title=Reserva_Shambala&amp;action=edit&amp;redlink=1" title="Reserva Shambala (aún no redactado)">Reserva Shambala</a>&nbsp;se apareó con un tigre y produjo un &ldquo;ti-tigón&rdquo;, aunque no se conocen casos de machos fértiles.</p>', '<p>Un&nbsp;<b>tigón</b>&nbsp;es un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_tigris" title="Panthera tigris">tigre</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>&nbsp;criados en cautiverio. Los tigones no son tan frecuentes como los híbridos inversos, llamados&nbsp;<a href="https://es.wikipedia.org/wiki/Ligre" title="Ligre">ligres</a>, producto de la unión de un león y una tigresa.', '', 1487199958, 2),
(7, 7, 1, 'Zonkey', '<p>A&nbsp;<b>zebroid</b>&nbsp;(also&nbsp;<b>zedonk</b>,&nbsp;<b>zorse</b>,&nbsp;<b>zebra mule</b>,&nbsp;<b>zonkey</b>, and&nbsp;<b>zebmule</b>) is the offspring of any cross between a&nbsp;<a href="https://en.wikipedia.org/wiki/Zebra" title="Zebra">zebra</a>&nbsp;and any other&nbsp;<a href="https://en.wikipedia.org/wiki/Equine" title="Equine">equine</a>: essentially, a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>. In most cases, the sire is a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>. Offspring of a donkey sire and zebra dam, called a&nbsp;<b>zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hinny" title="Hinny">hinny</a></b>, or&nbsp;<b>donkra</b>, do exist but are rare. Zebroids have been bred since the 19th century.&nbsp;<a href="https://en.wikipedia.org/wiki/Charles_Darwin" title="Charles Darwin">Charles Darwin</a>&nbsp;noted several zebra hybrids in his works.</p>', '<p>A&nbsp;<b>zebroid</b>&nbsp;(also&nbsp;<b>zedonk</b>,&nbsp;<b>zorse</b>,&nbsp;<b>zebra mule</b>,&nbsp;<b>zonkey</b>, and&nbsp;<b>zebmule</b>) is the offspring of any cross between a&nbsp;<a href="https://en.wikipedia.org/wiki/Zebra" title="Zebra">zebra</a>&nbsp;and any other&nbsp;<a href="https://en.wikipedia.org/wiki/Equine" title="Equine">equine</a>: essentially, a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>. In most cases, the sire is a zebra&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>.', '', 1487200066, 2),
(8, 8, 1, 'Zebroide', '<p>Un&nbsp;<b>zebroide</b>&nbsp;o&nbsp;<b>cebroide</b>&nbsp;es un animal híbrido obtenido del cruce de una&nbsp;<a href="https://es.wikipedia.org/wiki/Cebra" title="Cebra">cebra</a>&nbsp;con cualquier otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>. En esencia, se trata de un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de cebra. El padre de un zebroide es generalmente una cebra macho. No obstante, existen híbridos de este tipo que han nacido del cruce de una cebra hembra con algún otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>&nbsp;macho, aunque no son casos ordinarios.</p><p>Los zebroides han sido criados desde el siglo XIX.&nbsp;<a href="https://es.wikipedia.org/wiki/Charles_Darwin" title="Charles Darwin">Charles Darwin</a>&nbsp;registró algunos de ellos en sus trabajos.</p><p>Existieron dos especies similares a los cebroides, pero siendo especie y no híbridos:</p><ul><li>El&nbsp;<i><a href="https://es.wikipedia.org/wiki/Quagga" title="Quagga">quagga</a></i>&nbsp;africano, cuyo aspecto intenta actualmente recuperarse con híbridos.</li><li>El&nbsp;<i><a href="https://es.wikipedia.org/wiki/Equus_hydruntinus" title="Equus hydruntinus">encebro</a></i>&nbsp;o&nbsp;<i>zebro</i>&nbsp;que habitó la península ibérica hasta el siglo XV.</li></ul>', '<p>Un&nbsp;<b>zebroide</b>&nbsp;o&nbsp;<b>cebroide</b>&nbsp;es un animal híbrido obtenido del cruce de una&nbsp;<a href="https://es.wikipedia.org/wiki/Cebra" title="Cebra">cebra</a>&nbsp;con cualquier otro&nbsp;<a href="https://es.wikipedia.org/wiki/%C3%89quido" title="Équido">équido</a>. En esencia, se trata de un&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;de cebra. El padre de un zebroide es generalmente una cebra macho.', '', 1487200095, 2),
(9, 9, 1, 'Grolar Bear', '<p>A&nbsp;<b>grizzly&ndash;polar bear hybrid</b>&nbsp;(also named&nbsp;<b>grolar bear</b>,&nbsp;<b>pizzly bear</b><sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup><sup id="cite_ref-mallet_1-0"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-mallet-1">[1]</a></sup><sup id="cite_ref-barnosky_2-0"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-barnosky-2">[2]</a></sup>) is a rare&nbsp;<a href="https://en.wikipedia.org/wiki/Ursid_hybrid" title="Ursid hybrid">ursid hybrid</a>&nbsp;that has occurred both in captivity and in the wild. In 2006, the occurrence of this hybrid in nature was confirmed by testing the&nbsp;<a href="https://en.wikipedia.org/wiki/DNA" title="DNA">DNA</a>&nbsp;of a unique-looking bear that had been shot near&nbsp;<a href="https://en.wikipedia.org/wiki/Sachs_Harbour,_Northwest_Territories" title="Sachs Harbour, Northwest Territories">Sachs Harbour</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/Northwest_Territories" title="Northwest Territories">Northwest Territories</a>&nbsp;on&nbsp;<a href="https://en.wikipedia.org/wiki/Banks_Island" title="Banks Island">Banks Island</a>&nbsp;in the&nbsp;<a href="https://en.wikipedia.org/wiki/Canada" title="Canada">Canadian</a>&nbsp;<a href="https://en.wikipedia.org/wiki/Arctic" title="Arctic">Arctic</a>.<sup id="cite_ref-msn_3-0"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-msn-3">[3]</a></sup></p><p>Possible wild-bred&nbsp;<a href="https://en.wikipedia.org/wiki/Polar_bear" title="Polar bear">polar bear</a>-<a href="https://en.wikipedia.org/wiki/Grizzly_bear" title="Grizzly bear">grizzly bear</a>&nbsp;hybrids have been reported and shot in the past, but DNA tests were not available to verify the bears&#39; ancestry.</p><p>Analyses of&nbsp;<a href="https://en.wikipedia.org/wiki/DNA" title="DNA">DNA</a>&nbsp;sequences of bears have recovered multiple instances of&nbsp;<a href="https://en.wikipedia.org/wiki/Introgressive_hybridization" title="Introgressive hybridization">introgressive hybridization</a>&nbsp;between various bear species,<sup id="cite_ref-4"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-4">[4]</a></sup><sup id="cite_ref-5"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-5">[5]</a></sup><sup id="cite_ref-6"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-6">[6]</a></sup>including introgression of polar bear DNA into brown bears during the Pleistocene.</p>', '<p>A&nbsp;<b>grizzly&ndash;polar bear hybrid</b>&nbsp;(also named&nbsp;<b>grolar bear</b>,&nbsp;<b>pizzly bear</b><sup>[<i><a href="https://en.wikipedia.org/wiki/Wikipedia:Citation_needed" title="Wikipedia:Citation needed">citation needed</a></i>]</sup><sup id="cite_ref-mallet_1-0"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-mallet-1">[1]</a></sup><sup id="cite_ref-barnosky_2-0"><a href="https://en.wikipedia.org/wiki/Grizzly%E2%80%93polar_bear_hybrid#cite_note-barnosky-2">[2]</a></sup>) is a rare&nbsp;<a href="https://en.wikipedia.org/wiki/Ursid_hybrid" t', '', 1487200175, 2),
(10, 10, 1, 'Balfín', '<p>El&nbsp;<b>balfín</b>&nbsp;(<i><b><a href="https://es.wikipedia.org/wiki/Tursiops_truncatus" title="Tursiops truncatus">Tursiops truncatus</a></b></i>&nbsp;x&nbsp;<i><b><a href="https://es.wikipedia.org/wiki/Pseudorca_crassidens" title="Pseudorca crassidens">Pseudorca crassidens</a></b></i>) es un híbrido perteneciente a la familia&nbsp;<a href="https://es.wikipedia.org/wiki/Delphinidae" title="Delphinidae">Delphinidae</a>. Solo se conocen dos casos de este hibridismo, no habiéndose registrado jamás en la naturaleza. Estos ejemplares nacieron en cautiverio en el Sea Life Park de Hawái. El primer balfín registrado nació el&nbsp;<a href="https://es.wikipedia.org/wiki/15_de_mayo" title="15 de mayo">15 de mayo</a>&nbsp;de&nbsp;<a href="https://es.wikipedia.org/wiki/1985" title="1985">1985</a>.<sup id="cite_ref-1"><a href="https://es.wikipedia.org/wiki/Tursiops_truncatus_%C3%97_Pseudorca_crassidens#cite_note-1">1</a></sup></p>', '<p>El&nbsp;<b>balfín</b>&nbsp;(<i><b><a href="https://es.wikipedia.org/wiki/Tursiops_truncatus" title="Tursiops truncatus">Tursiops truncatus</a></b></i>&nbsp;x&nbsp;<i><b><a href="https://es.wikipedia.org/wiki/Pseudorca_crassidens" title="Pseudorca crassidens">Pseudorca crassidens</a></b></i>) es un híbrido perteneciente a la familia&nbsp;<a href="https://es.wikipedia.org/wiki/Delphinidae" title="Delphinidae">Delphinidae</a>. Solo se conocen dos casos de este hibridismo, no habiéndose registrado jamás en la naturaleza. Estos ejemplares nacieron en cautiverio en el Sea Life Park de Hawái.', '', 1487200201, 2),
(11, 11, 1, 'Bardot', '<p>Le&nbsp;<b>bardot</b>, ou&nbsp;<b>bardeau</b>, est un&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%89quid%C3%A9" title="Équidé">équidé</a>&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%89talon_(cheval)" title="Étalon (cheval)">étalon</a>&nbsp;et d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%82ne" title="Âne">ânesse</a>. Il est parfois confondu avec le&nbsp;<a href="https://fr.wikipedia.org/wiki/Mulet" title="Mulet">mulet</a>&nbsp;et la mule, issus du croisement réciproque entre un&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%82ne" title="Âne">âne</a>&nbsp;mâle et une&nbsp;<a href="https://fr.wikipedia.org/wiki/Jument" title="Jument">jument</a>. Hormis par la taille, le bardot est un peu plus proche du cheval que de l&#39;âne, notamment en raison de ses caractéristiques physiques et de sa préférence pour le&nbsp;<a href="https://fr.wikipedia.org/wiki/Hennissement" title="Hennissement">hennissement</a>, contrairement au mulet.</p><p>Le bardot est statistiquement&nbsp;<a href="https://fr.wikipedia.org/wiki/St%C3%A9rilit%C3%A9" title="Stérilité">stérile</a>&nbsp;en raison du nombre impair de ses&nbsp;<a href="https://fr.wikipedia.org/wiki/Chromosomes" title="Chromosomes">chromosomes</a>, hérités de ses deux parents. Les cas de bardots ayant donné des naissances, relatés dans la littérature depuis des siècles, étaient considérés avec&nbsp;<a href="https://fr.wikipedia.org/wiki/Scepticisme_rationnel" title="Scepticisme rationnel">scepticisme</a>&nbsp;par la communauté scientifique, jusqu&#39;aux années 1980 où plusieurs études ont prouvé qu&#39;une minorité de bardots femelles est capable de se reproduire, certainement grâce à la grande&nbsp;<a href="https://fr.wikipedia.org/wiki/Distance_g%C3%A9n%C3%A9tique_(g%C3%A9n%C3%A9tique_des_populations)" title="Distance génétique (génétique des populations)">proximité génétique</a>&nbsp;entre le cheval et l&#39;âne.</p><p>Bien qu&#39;il soit théoriquement apte aux mêmes utilisations que le mulet, le bardot n&#39;a jamais eu d&#39;importance économique particulière, il est généralement le résultat d&#39;un accident pour ses éleveurs. Le faible taux de&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9condit%C3%A9" title="Fécondité">fécondité</a>&nbsp;d&#39;un croisement entre étalon et ânesse le rend inintéressant et il est réputé pour posséder moins de qualités que le mulet, tout en n&#39;ayant ni la force du cheval, ni la robustesse de l&#39;âne.</p>', '<p>Le&nbsp;<b>bardot</b>, ou&nbsp;<b>bardeau</b>, est un&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%89quid%C3%A9" title="Équidé">équidé</a>&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybride</a>&nbsp;issu du croisement d&#39;un&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%89talon_(cheval)" title="Étalon (cheval)">étalon</a>&nbsp;et d&#39;une&nbsp;<a href="https://fr.wikipedia.org/wiki/%C3%82ne" title="Âne">ânesse</a>.', '', 1487200240, 2),
(12, 12, 1, 'Hinny', '<p>A&nbsp;<b>hinny</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Domestication" title="Domestication">domestic</a>&nbsp;equine&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;that is the offspring of a male&nbsp;<a href="https://en.wikipedia.org/wiki/Horse" title="Horse">horse</a>, a&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>, and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Donkey" title="Donkey">donkey</a>, a jenny. It is the&nbsp;<a href="https://en.wikipedia.org/wiki/Reciprocal_cross" title="Reciprocal cross">reciprocal cross</a>&nbsp;to the more common&nbsp;<a href="https://en.wikipedia.org/wiki/Mule" title="Mule">mule</a>, which is the product of a male donkey (jack) and a female horse, a&nbsp;<a href="https://en.wikipedia.org/wiki/Mare" title="Mare">mare</a>.</p>', '<p>A&nbsp;<b>hinny</b>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Domestication" title="Domestication">domestic</a>&nbsp;equine&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;that is the offspring of a male&nbsp;<a href="https://en.wikipedia.org/wiki/Horse" title="Horse">horse</a>, a&nbsp;<a href="https://en.wikipedia.org/wiki/Stallion" title="Stallion">stallion</a>, and a female&nbsp;<a href="https://en.wikipedia.org/wiki/Donkey" title="Donkey">donkey</a>, a jenny.', '', 1487142319, 2),
(13, 13, 1, 'Budégano', '<p>Un&nbsp;<b>burdégano</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/Animal" title="Animal">animal</a>&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;resultante del cruce entre un caballo (<i><a href="https://es.wikipedia.org/wiki/Equus_ferus_caballus" title="Equus ferus caballus">Equus ferus caballus</a></i>) y una asna o burra (<i><a href="https://es.wikipedia.org/wiki/Equus_africanus_asinus" title="Equus africanus asinus">Equus africanus asinus</a></i>). El&nbsp;<a href="https://es.wikipedia.org/wiki/Mula_(animal)" title="Mula (animal)">mulo</a>&nbsp;es el resultado del cruce entre yegua y asno.</p><p>El burdégano y el mulo son realmente animales creados por el hombre, ya que en estado natural las dos&nbsp;<a href="https://es.wikipedia.org/wiki/Especie_(biolog%C3%ADa)" title="Especie (biología)">especies</a>&nbsp;progenitoras vivían en continentes diferentes. El caballo y el burro tienen un antecesor común relativamente reciente, pertenecen al mismo&nbsp;<a href="https://es.wikipedia.org/wiki/G%C3%A9nero_(biolog%C3%ADa)" title="Género (biología)">género</a>, por lo que comparten más del 97% de sus&nbsp;<a href="https://es.wikipedia.org/wiki/Gen" title="Gen">genes</a>, lo suficientemente próximos para producir crías pero demasiado alejados para que sean fecundas, ya que el caballo tiene 64&nbsp;<a href="https://es.wikipedia.org/wiki/Cromosoma" title="Cromosoma">cromosomas</a>&nbsp;mientras que el burro, 62.</p>', '<p>Un&nbsp;<b>burdégano</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/Animal" title="Animal">animal</a>&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;resultante del cruce entre un caballo (<i><a href="https://es.wikipedia.org/wiki/Equus_ferus_caballus" title="Equus ferus caballus">Equus ferus caballus</a></i>) y una asna o burra (<i><a href="https://es.wikipedia.org/wiki/Equus_africanus_asinus" title="Equus africanus asinus">Equus africanus asinus</a></i>).', '', 1487142346, 2),
(14, 14, 1, 'Leopón', '<p>Un&nbsp;<b>leopón</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_pardus" title="Panthera pardus">leopardo</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>. La cabeza del animal se parece a la del león, y el resto del cuerpo se parece al de un leopardo con manchas difusas.</p>', '<p>Un&nbsp;<b>leopón</b>&nbsp;es el&nbsp;<a href="https://es.wikipedia.org/wiki/H%C3%ADbrido_(biolog%C3%ADa)" title="Híbrido (biología)">híbrido</a>&nbsp;producto del cruce entre un&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_pardus" title="Panthera pardus">leopardo</a>&nbsp;macho y una&nbsp;<a href="https://es.wikipedia.org/wiki/Panthera_leo" title="Panthera leo">leona</a>. La cabeza del animal se parece a la del león, y el resto del cuerpo se parece al de un leopardo con manchas difusas.</p>', '', 1487200316, 2),
(15, 15, 1, 'Leopon', '<p>A&nbsp;<b>leopon</b>&nbsp;<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈlɛpən/</a>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;resulting from the crossing of a male&nbsp;<a href="https://en.wikipedia.org/wiki/Leopard" title="Leopard">leopard</a>&nbsp;with a&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lioness</a>. The head of the animal is similar to that of a lion while the rest of the body carries similarities to leopards. These hybrids are produced in captivity and are unlikely to occur in the wild.<sup id="cite_ref-1"><a href="https://en.wikipedia.org/wiki/Leopon#cite_note-1">[1]</a></sup></p>', '<p>A&nbsp;<b>leopon</b>&nbsp;<a href="https://en.wikipedia.org/wiki/Help:IPA_for_English" title="Help:IPA for English">/ˈlɛpən/</a>&nbsp;is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;resulting from the crossing of a male&nbsp;<a href="https://en.wikipedia.org/wiki/Leopard" title="Leopard">leopard</a>&nbsp;with a&nbsp;<a href="https://en.wikipedia.org/wiki/Lion" title="Lion">lioness</a>. The head of the animal is similar to that of a lion while the rest of the body carries similarities to leopards.', '', 1487200279, 2),
(16, 16, 1, 'Léopon', '<p>Le&nbsp;<b>léopon</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>, produit du croisement entre un&nbsp;<a href="https://fr.wikipedia.org/wiki/L%C3%A9opard_(f%C3%A9lin)" title="Léopard (félin)">léopard</a>&nbsp;mâle et une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lionne</a>. Le croisement d&#39;un lion et d&#39;un léopard femelle existe également, sous le nom de &laquo;&nbsp;<b>lipard</b>&nbsp;&raquo; ou &laquo;&nbsp;<b>liard</b>&nbsp;&raquo; (c&#39;est en quelque sorte un synonyme de &laquo;&nbsp;léopon&nbsp;&raquo;). Ces&nbsp;<a href="https://fr.wikipedia.org/wiki/Hybride" title="Hybride">hybridations</a>&nbsp;se retrouvent principalement en&nbsp;<a href="https://fr.wikipedia.org/wiki/Parc_zoologique" title="Parc zoologique">captivité</a>.</p>', '<p>Le&nbsp;<b>léopon</b>&nbsp;est un&nbsp;<a href="https://fr.wikipedia.org/wiki/F%C3%A9lin_hybride" title="Félin hybride">félin hybride</a>, produit du croisement entre un&nbsp;<a href="https://fr.wikipedia.org/wiki/L%C3%A9opard_(f%C3%A9lin)" title="Léopard (félin)">léopard</a>&nbsp;mâle et une&nbsp;<a href="https://fr.wikipedia.org/wiki/Lion" title="Lion">lionne</a>.', '', 1487200329, 2),
(17, 17, 1, 'Dzo', '<p>A&nbsp;<b>dzo</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Standard_Tibetan" title="Standard Tibetan">Tibetan</a>&nbsp;མཛོ་ mdzo) (also spelled&nbsp;<b>zo</b>,&nbsp;<b>zho</b>&nbsp;and&nbsp;<b>dzho</b>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;between the&nbsp;<a href="https://en.wikipedia.org/wiki/Yak" title="Yak">yak</a>&nbsp;and domestic&nbsp;<a href="https://en.wikipedia.org/wiki/Cattle" title="Cattle">cattle</a>. The word dzo technically refers to a male hybrid, while a female is known as a&nbsp;<i>dzomo</i>&nbsp;or&nbsp;<i>zhom</i>. In&nbsp;<a href="https://en.wikipedia.org/wiki/Mongolian_language" title="Mongolian language">Mongolian</a>&nbsp;it is called&nbsp;<b>khainag</b>&nbsp;(хайнаг). There is also the English language&nbsp;<a href="https://en.wiktionary.org/wiki/Portmanteau_word" title="wikt:Portmanteau word">portmanteau term</a>&nbsp;of&nbsp;<b>yattle</b>, a combination of the words yak and cattle,<sup id="cite_ref-1"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-1">[1]</a></sup>&nbsp;as well as&nbsp;<b>yakow</b>,<sup id="cite_ref-2"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-2">[2]</a></sup><sup id="cite_ref-3"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-3">[3]</a></sup>&nbsp;a combination of the words yak and cow.</p><p>Dzomo are&nbsp;<a href="https://en.wikipedia.org/wiki/Fertility" title="Fertility">fertile</a>&nbsp;(or,&nbsp;<a href="https://en.wikipedia.org/wiki/Fecundity" title="Fecundity">fecund</a>) while dzo are&nbsp;<a href="https://en.wikipedia.org/wiki/Sterility_(physiology)" title="Sterility (physiology)">sterile</a>. As they are a product of the hybrid genetic phenomenon of&nbsp;<a href="https://en.wikipedia.org/wiki/Heterosis" title="Heterosis">heterosis</a>&nbsp;(hybrid vigor), they are larger and stronger than yak or cattle from the region.<sup id="cite_ref-4"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-4">[4]</a></sup>&nbsp;In Mongolia and Tibet, khainags are thought to be more productive than cattle or yaks in terms of both milk and meat production.<sup id="cite_ref-5"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-5">[5]</a></sup><sup id="cite_ref-son_6-0"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-son-6">[6]</a></sup></p><p>Dzomo can be&nbsp;<a href="https://en.wikipedia.org/wiki/Backcrossing" title="Backcrossing">back crossed</a>. As a result, many supposedly pure yak or pure cattle probably carry each other&#39;s genetic material. In&nbsp;<a href="https://en.wikipedia.org/wiki/Mongolia" title="Mongolia">Mongolia</a>&nbsp;and&nbsp;<a href="https://en.wikipedia.org/wiki/Tibet" title="Tibet">Tibet</a>, the result of a khainag crossed with either a domestic bull or yak bull is called&nbsp;<i>ortoom</i>&nbsp;(three-quarter-bred) and an&nbsp;<i>ortoom</i>&nbsp;crossed with a domestic bull or yak bull results in a&nbsp;<i>usan güzee</i>&nbsp;(one-eighth-bred).<sup id="cite_ref-son_6-1"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-son-6">[6]</a></sup><sup id="cite_ref-7"><a href="https://en.wikipedia.org/wiki/Dzo#cite_note-7">[7]</a></sup></p>', '<p>A&nbsp;<b>dzo</b>&nbsp;(<a href="https://en.wikipedia.org/wiki/Standard_Tibetan" title="Standard Tibetan">Tibetan</a>&nbsp;མཛོ་ mdzo) (also spelled&nbsp;<b>zo</b>,&nbsp;<b>zho</b>&nbsp;and&nbsp;<b>dzho</b>) is a&nbsp;<a href="https://en.wikipedia.org/wiki/Hybrid_(biology)" title="Hybrid (biology)">hybrid</a>&nbsp;between the&nbsp;<a href="https://en.wikipedia.org/wiki/Yak" title="Yak">yak</a>&nbsp;and domestic&nbsp;<a href="https://en.wikipedia.org/wiki/Cattle" title="Cattle">cattle</a>.', '', 1487199805, 2);
INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES
('page', 'Page', 'node', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'page'),
('story', 'Story', 'node', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'story');
